import React from 'react';

let count = 0;
const IncNum = () => {
    
    count++;
    alert("Clicked");
}

const App3 = () => {

    return (
        <>
            <h1> { count}</h1>
            <button onClick={IncNum}>Click Me</button>
            </>
    );
}

export { App3,IncNum };
